import React from 'react';
import ThemeToggle from './ThemeToggle';
import Button from '../ui/Button';

const Navbar = () => {
  return (
    <nav className="sticky top-0 z-40 bg-gradient-to-r from-white/5 via-white/3 to-transparent backdrop-blur">
      <div className="container flex items-center justify-between px-4 py-4 mx-auto">
        <div className="flex items-center gap-4">
          <a href="/" className="text-2xl font-extrabold tracking-tight text-gray-900 dark:text-white">Vicationplanner</a>
          <div className="items-center hidden gap-2 ml-6 md:flex">
            <a href="/" className="text-sm text-gray-600 dark:text-gray-300 hover:underline">Home</a>
            <a href="/trip-planner" className="text-sm text-gray-600 dark:text-gray-300 hover:underline">Trip Planner</a>
            <a href="/saved" className="text-sm text-gray-600 dark:text-gray-300 hover:underline">Saved Trips</a>
          </div>
        </div>
        <ThemeToggle />

        <div className="flex items-center gap-3 bg-red-500 ">

          <Button intent="ghost" size="sm" onClick={() => window.location.href = '/booking'}>Book Trip</Button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
